จาก $z^5 = 1$  เราสามารถรู้ $z^5 - 1 = 0$  ซึ่ง
\begin{align*}
z^5 - 1 &= (z - 1)(z^4 + z^3 + z^2 + z + 1) \\
&= (z - 1)(z^2 + z + 1)(z^2 - z + 1) \\
&= 0.
\end{align*}
เนื่อง $z \neq 1$  เราจึงต้องพิจารณา
\begin{align*}
z^2 + z + 1 &= 0 \\
z^2 - z + 1 &= 0.
\end{align*}
ในกรณี $z^2 + z + 1 = 0$  เราสามารถรู้
\begin{align*}
z^2 + z + 1 &= 0 \\
z^2 + z + 1 + \frac{1}{z^2} + \frac{1}{z} + 1 &= 0 + \frac{1}{z^2} + \frac{1}{z} + 1 \\
z^2 + \frac{1}{z^2} + z + \frac{1}{z} + 2 &= 0 \\
z + \frac{1}{z} + z^2 + \frac{1}{z^2} &= \boxed{-2}.
\end{align*}
ในกรณี $z^2 - z + 1 = 0$  เราสามารถรู้
\begin{align*}
z^2 - z + 1 &= 0 \\
z^2 - z + 1 + \frac{1}{z^2} - \frac{1}{z} + 1 &= 0 + \frac{1}{z^2} - \frac{1}{z} + 1 \\
z^2 + \frac{1}{z^2} - z - \frac{1}{z} + 2 &= 0 \\
z + \frac{1}{z} + z^2 + \frac{1}{z^2} &= \boxed{-2}.
\end{align*}
$\square$

Let $r$ be the radius of the base of the cylinder.  The volume of the cylinder is $\pi r^2 h$, where $h$ is the height of the water.  When the water level is raised by 4 meters, the volume increases by $20\pi$ cubic meters, so we have  \begin{align*}
\pi r^2 (h+4) - \pi r^2 h &= 20\pi \\
4\pi r^2 &= 20\pi \\
r^2 &= 5 \\
r &= \boxed{\sqrt{5}}.
\end{align*}

