\begin{align*}
\sqrt[3]{x^2 - 4x + 4} &= 16 \\
x^2 - 4x + 4 &= 16^3 \\
x^2 - 4x + 4 &= 4096 \\
x^2 - 4x - 4092 &= 0 \\
(x - 62)(x + 66) &= 0
\end{align*}  \begin{align*}
x &= 62 \quad \text{or} \quad x = -66
\end{align*}  \begin{align*}
x &= \boxed{62}
\end{align*}  (We discard $x = -66$ because it is not positive.)
